import React from 'react';
import { useStep } from 'react-hooks-helper';
import { Create } from './register/Create';
import { Info } from './register/Info';
import { Personnal } from './register/Personnal';
import { Submit } from './register/Submit';

const steps = [
	{id : 'create'},
	{id : 'personnal'},
	{id : 'info'},
	{id : 'submit'},
];

export const Register = () => {

	const { step, navigation } = useStep({
		steps,
		initialStep: 0,
	});

	const props = {navigation};

	switch(step.id){
		case "create":
			return <Create {...props} />;
		case "personnal":
			return <Personnal {...props} />;
		case "info":
			return <Info {...props} />;
		case "submit":
			return <Submit {...props} />;
	};
}
